import React from 'react';
import BarraNavegacao from './BarraNavegacao';
import Footer from './Footer';

// Este componente de layout é projetado para todas as páginas da área logada.
// Ele garante uma aparência consistente com um fundo padronizado e conteúdo centralizado.
const LayoutLogado = ({ children }) => {
    return (
        <>
            {/* A camada de fundo com o padrão de unicórnio */}
            <div className="dashboard-background-layer"></div>

            <BarraNavegacao />

            {/* O 'dashboard-container' centraliza o conteúdo vertical e horizontalmente */}
            <main className="dashboard-container">
                {children}
            </main>

            <Footer />
        </>
    );
};

export default LayoutLogado;
